import React, { useState } from 'react';
import './assets/css/CompanyForm.css'; // External CSS for additional styling
import guestAvatar from './assets/image.png';
const defaultImage = '/assets/images/guest-avatar.png'; // Path to default guest image

const CompanyForm = () => {
    const [formData, setFormData] = useState({
        companyName: '',
        registrationType: '',
        regdCity: '',
        regdArea: '',
        regdPin: '',
        workCity: '',
        workArea: '',
        workPin: '',
        directorName: '',
        gender: '',
        email: '',
        phone: '',
        loginEmail: '',
        password: '',
        confirmPassword: '',
        profileImage: '', // Add profileImage error
        agreeToTerms: '' 
    });

    const [errors, setErrors] = useState<{ [key: string]: string }>({});

    const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const validateForm = () => {
        const newErrors: { [key: string]: string } = {};
        
        if (!formData.companyName) newErrors.companyName = 'Company name is required';
        if (!formData.registrationType) newErrors.registrationType = 'Registration type is required';
        if (!formData.email) newErrors.email = 'Email is required';
        if (!/\S+@\S+\.\S+/.test(formData.email)) newErrors.email = 'Invalid email address';
        if (!formData.phone || !/^\d{10}$/.test(formData.phone)) newErrors.phone = 'Valid phone number is required';
        if (!formData.password) newErrors.password = 'Password is required';
        if (formData.password !== formData.confirmPassword) newErrors.confirmPassword = 'Passwords do not match';

        setErrors(newErrors);
        return Object.keys(newErrors).length === 0;
    };

    const handleSubmit = (e: React.FormEvent) => {
        e.preventDefault();
        if (validateForm()) {
            // Handle form submission
            console.log('Form submitted successfully:', formData);
        }
    };

    return (
        <form onSubmit={handleSubmit} className="company-form">
              {/* Profile Image Upload */}
            <div className="form-group text-center">
              <label htmlFor="profileImage">Profile Image</label>
              <div className="profile-image-preview">
                <img
                  src={formData.profileImage || guestAvatar} // Use uploaded image or fallback to guest avatar
                  alt="Profile Preview"
                  className="rounded-circle"
                />
              </div>
              <input
                type="file"
                id="profileImage"
                name="profileImage"
                accept="image/*"
                onChange={handleFileChange}
              />
            </div>
            <div>
                <label>Company Name</label>
                <input type="text" name="companyName" value={formData.companyName} onChange={handleChange} />
                {errors.companyName && <span className="error">{errors.companyName}</span>}
            </div>

            <div>
                <label>Registration Type</label>
                <select name="registrationType" value={formData.registrationType} onChange={handleChange}>
                    <option value="">Select</option>
                    <option value="ltd">Ltd</option>
                    <option value="pvt ltd">Pvt Ltd</option>
                    <option value="llp">LLP</option>
                    <option value="partnership">Partnership</option>
                    <option value="firm">Firm</option>
                    <option value="upc">UPC</option>
                    <option value="individual">Individual</option>
                </select>
                {errors.registrationType && <span className="error">{errors.registrationType}</span>}
            </div>

            <div>
                <label>Registered Address</label>
                <input type="text" name="regdCity" placeholder="City" value={formData.regdCity} onChange={handleChange} />
                <input type="text" name="regdArea" placeholder="Area" value={formData.regdArea} onChange={handleChange} />
                <input type="text" name="regdPin" placeholder="Pin" value={formData.regdPin} onChange={handleChange} />
            </div>

            <div>
                <label>Work Address</label>
                <input type="text" name="workCity" placeholder="City" value={formData.workCity} onChange={handleChange} />
                <input type="text" name="workArea" placeholder="Area" value={formData.workArea} onChange={handleChange} />
                <input type="text" name="workPin" placeholder="Pin" value={formData.workPin} onChange={handleChange} />
            </div>

            <div>
                <label>Director/Owner Name</label>
                <input type="text" name="directorName" value={formData.directorName} onChange={handleChange} />
            </div>

            <div>
                <label>Gender</label>
                <select name="gender" value={formData.gender} onChange={handleChange}>
                    <option value="">Select</option>
                    <option value="male">Male</option>
                    <option value="female">Female</option>
                    <option value="other">Other</option>
                </select>
            </div>

            <div>
                <label>Email ID</label>
                <input type="email" name="email" value={formData.email} onChange={handleChange} />
                {errors.email && <span className="error">{errors.email}</span>}
            </div>

            <div>
                <label>Phone Number</label>
                <input type="text" name="phone" value={formData.phone} onChange={handleChange} />
                {errors.phone && <span className="error">{errors.phone}</span>}
            </div>

            <div>
                <label>Login Email ID</label>
                <input type="email" name="loginEmail" value={formData.loginEmail} onChange={handleChange} />
            </div>

            <div>
                <label>Password</label>
                <input type="password" name="password" value={formData.password} onChange={handleChange} />
                {errors.password && <span className="error">{errors.password}</span>}
            </div>

            <div>
                <label>Confirm Password</label>
                <input type="password" name="confirmPassword" value={formData.confirmPassword} onChange={handleChange} />
                {errors.confirmPassword && <span className="error">{errors.confirmPassword}</span>}
            </div>

            <button type="submit">Submit</button>
        </form>
    );
};

export default CompanyForm;
